// "output" // 10%
    void output() {
    double total_score = 0;

    GameController *controller = new GameController(
            SAMPLE_INPUT_SPACE_GRID_FILENAME,
            SAMPLE_INPUT_CELESTIAL_OBJECTS_FILENAME,
            SAMPLE_LEADERBOARD_FILENAME,
            SAMPLE_INPUT_PLAYER_FILENAME,
            SAMPLE_DEFAULT_PLAYER_NAME);

    // Load expected lines from file
    std::vector<std::string> expected_lines;
    std::ifstream expected_file(EXPECTED_OUTPUT_FILENAME);
    std::string expected_line;
    while (std::getline(expected_file, expected_line)) {
        expected_lines.push_back(trim(expected_line));
    }
    expected_file.close();

    // Create a stringstream to capture output
    std::stringstream buffer;

    // Redirect cout to buffer
    std::streambuf *oldCoutStreamBuf = std::cout.rdbuf();
    std::cout.rdbuf(buffer.rdbuf());

    // Run the game
    controller->play(SAMPLE_INPUT_COMMANDS_FILENAME);

    // Restore original cout buffer
    std::cout.rdbuf(oldCoutStreamBuf);

    // Compare each line in the buffer with the expected output
    std::string line;
    int j = 0;
    while (std::getline(buffer, line) && j < expected_lines.size()) {
        std::string trimmed_line = trim(line);
        std::string trimmed_expected_line = expected_lines[j];

        // Compare with expected line
        if (trimmed_line == trimmed_expected_line) {
            total_score += 1;
        }
        j++;
    }

    total_score /= expected_lines.size();

    cout << fixed << setprecision(2) << total_score;
    delete controller;
}

